import Home from "~/Pages/Home";
import Following from "~/Pages/Following";
// public router
const publicRouter = [
  {
    path: "/",
    component: Home,
  },
  {
    path: "/following",
    component: Following,
  },
];
const privateRouter = [];
export {publicRouter, privateRouter};
